INSERT INTO `posts` (`id`, `country`, `city`, `startDate`, `endDate`, `mainTitle`, `subTitle`, `tags`, `rate`, `share`, `content`, `authorId`, `createdTime`, `status`) VALUES
(1, '日本', '東京', '2024-10-06', '2024-10-31', '超級可愛的熊本熊!', '印象深刻的活火山之旅~', '熊本,東京', 4, 1, '終於看到心心念念的熊本熊!\r\n現場拍真的是超~~~~大一隻😆😆🤣🤣\r\n除此之外，沒想到熊本的食物都超級好吃！\r\n除了拉麵以外，還有超級有名的赤牛丼都好吃到回國了還在想念👍👍\r\n不過另一個名產生馬肉......抱歉我還是沒辦法\r\n這超過我的生理界線了😜\r\n\r\n景點的重點活火山，光是路途中的山景就讓人覺得不虛此行，日本的山水風景真的都太好看了🤩\r\n還有印象深刻的熊本城和水前寺成趣園\r\n整個日式氣味迎面而來，走在裡面都像是看日本時代劇一樣！\r\n\r\n這趟旅程真的太開心了，到熊本的朋友一定要嘗嘗他們的赤牛丼🤤🤤🤤', 2, '2024-10-08 02:25:10', 1),
(2, '日本', '京都', '2024-10-15', '2024-10-23', '超級迷人的京都之旅！', '', '京都旅行,紅葉季', 5, 1, '終於來到了心心念念的京都！\\r\\n看到滿滿的紅葉，現場真的美到不行🍁✨～不論是金閣寺的倒影，還是嵐山的竹林，每一個角落都像幅畫一樣。📸\\r\\n除了美景之外，京都的食物也超棒！😋\\r\\n不只有抹茶甜點讓人上癮，還有道地的湯豆腐和懷石料理，都好吃得讓人難忘～🥢', 2, '2024-10-16 11:08:56', 1),
(3, '法國', '巴黎', '2024-10-16', '2024-10-18', '巴黎的浪漫藝術之旅', NULL, '巴黎之旅,艾菲爾鐵塔,浪漫之都', 4, 1, '塞納河畔的夕陽，艾菲爾鐵塔的燈光，浪漫指數爆表💫。白天在羅浮宮欣賞藝術，晚上在香榭麗舍大道享受晚餐，整個行程夢幻極了。🥐巴黎的可頌和馬卡龍真的值得一試！', 3, '2024-10-25 11:16:40', 1),
(4, '美國', '紐約', '2024-10-17', '2024-10-23', '紐約的都市探險', NULL, '紐約旅行', 4, 1, '一天走在繁華的第五大道，一天在中央公園放鬆，紐約讓人應接不暇！🌆還參觀了大都會博物館，感受到濃濃的文化氣息。比薩、漢堡和芝士蛋糕都不能錯過～🍕🍔', 4, '2024-10-24 11:18:38', 1),
(5, '澳洲', '雪梨', '2024-10-10', '2024-10-20', '雪梨的海港之美', NULL, '雪梨旅行,邦迪海灘', 5, 1, '悉尼歌劇院的建築真的太壯觀了！在海港大橋上俯瞰全景，感覺就像置身天堂🌊。還去了邦迪海灘，陽光和沙灘讓人完全放鬆～🐠海鮮料理也超級鮮美！', 5, '2024-10-26 11:20:22', 1),
(6, '冰島', '冰島', '2024-10-15', '2024-10-31', '冰島的極光追尋', '', '冰島極光,自然之旅,北國之旅,火山奇景', 4, 1, '冰島的自然景觀真是讓人震撼！在藍湖溫泉泡湯後，夜晚迎來了極光的驚喜✨。還參觀了瀑布和火山，這趟旅程充滿大自然的奇蹟～', 2, '2024-10-23 11:22:35', 1),
(7, '義大利', '羅馬', '2024-11-05', '2024-11-11', '義大利的美食與歷史之旅', NULL, '義大利之旅,披薩,義大利麵,比薩斜塔', 4, 1, '在羅馬鬧區品嚐道地義大利麵和披薩，感覺每一口都像在品味藝術🍝。走訪了古羅馬競技場和梵蒂岡博物館，歷史氣息撲面而來～🇮🇹', 3, '2024-10-29 11:27:43', 1),
(8, '泰國', '曼谷', '2024-10-22', '2024-10-28', '泰國的熱帶探險', NULL, '泰國旅行,泰國旅行,泰國旅行,泰國旅行,泰國旅行', 3, 1, '曼谷街頭的夜市真的太精彩了！🌶️品嚐了泰式炒河粉和芒果糯米飯後，還去拜訪了大皇宮和玉佛寺，感受到濃厚的文化氣息。接著前往普吉島的海灘享受假期～🏝️\r\n曼谷街頭的夜市真的太精彩了！🌶️品嚐了泰式炒河粉和芒果糯米飯後，還去拜訪了大皇宮和玉佛寺，感受到濃厚的文化氣息。接著前往普吉島的海灘享受假期～🏝️\r\n曼谷街頭的夜市真的太精彩了！🌶️品嚐了泰式炒河粉和芒果糯米飯後，還去拜訪了大皇宮和玉佛寺，感受到濃厚的文化氣息。接著前往普吉島的海灘享受假期～🏝️\r\n曼谷街頭的夜市真的太精彩了！🌶️品嚐了泰式炒河粉和芒果糯米飯後，還去拜訪了大皇宮和玉佛寺，感受到濃厚的文化氣息。接著前往普吉島的海灘享受假期～🏝️\r\n曼谷街頭的夜市真的太精彩了！🌶️品嚐了泰式炒河粉和芒果糯米飯後，還去拜訪了大皇宮和玉佛寺，感受到濃厚的文化氣息。接著前往普吉島的海灘享受假期～🏝️\r\n曼谷街頭的夜市真的太精彩了！🌶️品嚐了泰式炒河粉和芒果糯米飯後，還去拜訪了大皇宮和玉佛寺，感受到濃厚的文化氣息。接著前往普吉島的海灘享受假期～🏝️', 4, '2024-10-26 11:28:39', 1),
(9, '埃及', '開羅', '2024-10-18', '2024-10-28', '埃及的金字塔之旅', NULL, '埃及旅行', 5, 1, '終於看到傳說中的金字塔和獅身人面像，震撼無法言喻！🌄參觀了開羅博物館，見識到法老的珍寶和木乃伊。尼羅河上的郵輪晚餐更是讓人回味無窮～', 5, '2024-10-19 11:29:47', 1),
(10, '美國', '夏威夷', '2024-10-15', '2024-10-22', '夏威夷的熱情海風', NULL, '夏威夷旅行,陽光,比基尼,沙灘', 5, 1, '在威基基海灘迎著浪花玩衝浪🏄‍♂️，感受夏威夷的熱情。火山國家公園的景觀也讓人嘆為觀止！夜晚品嚐波奇碗和夏威夷當地特色餐，這裡真的是天堂～🌴', 3, '2024-10-27 11:30:36', 1);

